import { createCanvas } from "./utils.js";
import { Camera } from "./stateMachine.js";
import { toBase64 } from "./utils.js";

export const swapFace = (img) => {
  console.log("swapFace was called");
  const myImage = toBase64(img);
  const myImage2 =
    "data:image/jpeg;base64,";
  fetch("https://felixrosberg-face-swap.hf.space/api/predict/", {
    method: "POST",
    body: JSON.stringify({
      data: [myImage, myImage2, 100, 10, [""]],
    }),
    headers: { "Content-Type": "application/json" },
  })
    .then(function (response) {
      return response.json();
    })
    .then(function (json_response) {
      //return base64 of swapped image
      console.log("swap done");
      console.log(Camera.state);
      // console.log(json_response.data[0]);
      Camera.changeState("SWAPPED");
      Camera.dispatch("display", [{ result: json_response.data[0] }]);
      return json_response.data[0];
    });
};
